```cpp
#include <iostream>
#include <memory>
#include <vector>
#include <string>

// Function to convert markdown text to HTML
std::string markdown_to_html(const std::string& markdown_text) {
    std::vector<std::pair<std::string_view, std::string>> templates = {
        {"p", "<p>"},  // paragraph
        {"h1", "<h1>"},
        {"h2", "<h2>"},
        {"h3", "<h3>"},
        {"h4", "<h4>"},
        {"h5", "<h5>"},
        {"h6", "<h6>"}
    };

    std::vector<std::pair<std::string_view, std::string>> replacements = {
        {"{markdown}", "code"},
        {"<pre>", "<pre>\n"},
        {"</pre>", "</pre>\n"},
        {"<code>", "<code style='background-color: #f0f0f0; color: #000;'>"},
        {"</code>", "</code>\n"}
    };

    std::string html;
    for (auto& [pattern, replacement] : templates) {
        size_t start = markdown_text.find(pattern);
        if (start != std::string::npos) {
            while (start != std::string::npos) {
                auto end = markdown_text.find(pattern, start + pattern.length());
                if (end == std::string::npos || end >= markdown_text.size()) break;

                std::string content = markdown_text.substr(start, end - start);

                if (!replacements.empty() && replacements.count(pattern)) {
                    content = replacements[pattern];
                }

                if (content.empty() && !replacements.empty() && replacements.back().first.empty()) {
                    content = "<br>";
                }

                html += replacement + content;
                html += "\n";
            }
            markdown_text.erase(start, std::string::npos);  // Remove matched pattern from input string
        } else {
            html += markdown_text;
            html += "\n";
        }
    }

    return html;
}

int main() {
    std::string markdown_text = R"(
    * Title
    * Subtitle

    This is a sample markdown text.
    )";

    std::string html = markdown_to_html(markdown_text);
    std::cout << html << std::endl;

    return 0;
}
```

