Here's how you could implement this:

```javascript
// Function to validate prime numbers
function validatePrime(arr) {
    // Iterate over each number in the array
    for (let i = 0; i < arr.length; i++) {
        let num = arr[i];

        // Check divisibility starting from 2 up to the square root of the current number
        for (let j = 2; j <= Math.sqrt(num); j++) {
            if (num % j === 0) {
                // If divisible by any number other than 1 and itself, it's not a prime
                return false;
            }
        }

        // If no factors were found, the number is prime
        return true;
    }
}

// Array of five numbers
const numbers = [2, 3, 5, 7, 11];

// Validate the prime status of each number in the array
numbers.forEach(number => {
    if (validatePrime(numbers)) {
        console.log(`${number} is a prime number.`);
    } else {
        console.log(`${number} is not a prime number.`);
    }
});
```

This script defines the `validatePrime` function which iterates through the provided array, checking for divisibility (excluding 1 and the number itself) among all numbers up to the square root of the current number being checked. If any divisor is found, the function returns `false`, indicating the number is not a prime. Otherwise, once no divisors are found, the function concludes that the number is a prime and logs its confirmation.

