output_2:
To determine whether a given integer \( n \) is a power of three without using loops or recursion, we can utilize logarithms. The idea is based on the properties of logarithms:

1. If \( a^b = c \), then \( b = \log_{a}(c) \).

2. For any positive number \( a > 1 \), the logarithm function \( \log_a(c) \) satisfies \( 0 < \log_a(c) < 1 \). This property will help us determine if \( n \) is a power of three by checking if its logarithm base 3 lies within this range.

Here's a Java implementation of the above approach:

```java
import java.math.BigInteger;

class PowerOfThree {

    /**
     * Checks if the given integer n is a power of three.
     * 
     * @param n The integer to check.
     * @return true if n is a power of three, false otherwise.
     */
    public boolean isPowerOfThree(int n) {
        // BigInteger for handling very large numbers
        BigInteger bigN = new BigInteger(String.valueOf(n));

        // Calculate log base 3 of the absolute value of n
        double logVal = Math.log(bigN.doubleValue()) / Math.log(3);

        // Check if log is an integer
        return Math.abs(logVal - Math.floor(logVal)) < 1e-9;
    }

    // Method to verify the correctness of the solution
    public static void main(String[] args) {
        PowerOfThree solver = new PowerOfThree();
        System.out.println(solver.isPowerOfThree(27)); // true
        System.out.println(solver.isPowerOfThree(0));  // false
        System.out.println(solver.isPowerOfThree(-1)); // false
    }
}
```

This code snippet defines a `PowerOfThree` class with a method `isPowerOfThree`. It calculates the logarithm of the absolute value of the input number using `Math.log()` and checks if the result is an exact fractional value (within a precision tolerance). The provided test cases demonstrate the functionality of the solution.

