#include <iostream>
#include <fstream>
#include <string>

int main() {
    std::ifstream inputFile("example.txt"); // Replace "example.txt" with your actual file name

    if (!inputFile) {
        std::cout << "Error: Unable to open the file." << std::endl;
        return 1;
    }

